Innovation Fund supports innovation in t:
Inovacijų fondas remia inovacijas daug energijos naudojančių pramonės šakų srityse; 
atsinaujinantys energijos šaltiniai; 
energijos kaupimas; 
anglies surinkimas, naudojimas ir saugojimas. 
Fondo tikslas – remti investicijas į naujos kartos technologijas, reikalingas ES perėjimui prie mažo anglies dioksido kiekio technologijų mažinimo, taip pat skatinti ES įmonių augimą ir konkurencingumą.
